def progress():
    if not current_user.is_superuser:
        return redirect(url_for('index'))

    users = User.query.all()
    user_progress = []
    for user in users:
        translations_count = Translation.query.filter_by(user_id=user.id).count()
        user_progress.append({
            'username': user.username,
