package tparallel

type T struct {
	parent               *T
	parallelChildRun     int
	parallelChildChannel chan struct{}
	stopChildChannel     chan bool
}

func (t *T) Parallel() {
	t.parent.stopChildChannel <- true
	t.parent.parallelChildChannel <- struct{}{}
}

func (t *T) Run(subtest func(t *T)) {
	childT := T{
		parent:               t,
		parallelChildRun:     0,
		parallelChildChannel: make(chan struct{}),
		stopChildChannel:     make(chan bool),
	}
	go func() {
		subtest(&childT)
		for i := 0; i < childT.parallelChildRun; i++ {
			<-childT.parallelChildChannel
		}
		for i := 0; i < childT.parallelChildRun; i++ {
			<-childT.stopChildChannel
		}
		childT.parent.stopChildChannel <- false
	}()
	value := <-childT.parent.stopChildChannel
	if value {
		t.parallelChildRun++
	}
}

func Run(topTests []func(t *T)) {
	testManager := T{
		parent:               nil,
		parallelChildRun:     0,
		parallelChildChannel: make(chan struct{}),
		stopChildChannel:     make(chan bool),
	}
	for _, test := range topTests {
		testManager.Run(test)
	}
	for i := 0; i < testManager.parallelChildRun; i++ {
		<-testManager.parallelChildChannel
	}
	for i := 0; i < testManager.parallelChildRun; i++ {
		<-testManager.stopChildChannel
	}
}

